// SPDX-License-Identifier: BUSL-1.1
pragma solidity =0.8.4;

import "./Libraries/SafeMath.sol";
import "./Libraries/ABDKMathQuad.sol";
import "./Libraries/TvlOracleLibrary.sol";
import "./Interfaces/Interfaces.sol";

// sliding window oracle that uses observations collected over a window to provide moving tvl averages in the past
// `windowSize` with a precision of `windowSize / granularity`
// note this is a singleton oracle and only needs to be deployed once per desired parameters, which
// differs from the simple oracle which must be deployed once per tvlOracle.
contract TvlSlidingWindowOracle {
    using ABDKMathQuad for int128;

    struct Observation {
        uint256 timestamp;
        uint256 tvlCumulative;
    }
    struct TimeWeightedAverageTVL {
        uint256 timestamp;
        uint256 tvl;
    }

    // the desired amount of time over which the moving average should be computed, e.g. 24 hours
    uint256 public immutable windowSize;
    // the number of observations stored for each tvlOracle, i.e. how many tvl observations are stored for the window.
    // as granularity increases from 1, more frequent updates are needed, but moving averages become more precise.
    // averages are computed over intervals with sizes in the range:
    //   [windowSize - (windowSize / granularity) * 2, windowSize]
    // e.g. if the window size is 24 hours, and the granularity is 24, the oracle will return the average tvl for
    //   the period:
    //   [now - [22 hours, 24 hours], now]
    uint8 public immutable granularity;
    // this is redundant with granularity and windowSize, but stored for gas savings & informational purposes.
    uint256 public immutable periodSize;

    // mapping from tvl oracle address to a list of tvl observations of that tvl oracle
    mapping(address => Observation[]) public tvlObservations;
    mapping(address => TimeWeightedAverageTVL[]) public timeWeightedAverageTVL;

    constructor(uint256 windowSize_, uint8 granularity_) public {
        require(granularity_ > 1, "SlidingWindowOracle: GRANULARITY");
        require(
            (periodSize = windowSize_ / granularity_) * granularity_ ==
                windowSize_,
            "SlidingWindowOracle: WINDOW_NOT_EVENLY_DIVISIBLE"
        );
        windowSize = windowSize_;
        granularity = granularity_;
    }

    // returns the index of the observation corresponding to the given timestamp
    function observationIndexOf(uint256 timestamp)
        public
        view
        returns (uint8 index)
    {
        uint256 epochPeriod = timestamp / periodSize;
        return uint8(epochPeriod % granularity);
    }

    // returns the observation from the oldest epoch (at the beginning of the window) relative to the current time
    function getFirstObservationInWindow(address tvlOracle)
        private
        view
        returns (Observation storage firstObservation)
    {
        uint8 observationIndex = observationIndexOf(block.timestamp);
        // no overflow issue. if observationIndex + 1 overflows, result is still zero.
        uint8 firstObservationIndex = (observationIndex + 1) % granularity;
        firstObservation = tvlObservations[tvlOracle][firstObservationIndex];
    }

    /**
     * @notice update the cumulative tvl for the observation at the current timestamp
     * and saves the current weighted average.
     * Each observation is updated at most once per epoch period
     * @param tvlOracle address of the TVL oracle to update
     */
    function update(address tvlOracle) external {
        TvlOracle(tvlOracle).update();

        // populate the array with empty observations (first call only)
        for (
            uint256 i = tvlObservations[tvlOracle].length;
            i < granularity;
            i++
        ) {
            tvlObservations[tvlOracle].push();
        }

        // get the observation for the current period
        uint8 observationIndex = observationIndexOf(block.timestamp);
        Observation storage observation = tvlObservations[tvlOracle][
            observationIndex
        ];

        // we only want to commit updates once per period (i.e. windowSize / granularity)
        uint256 timeElapsed = block.timestamp - observation.timestamp;
        if (timeElapsed > periodSize) {
            uint256 tvlCumulative = TvlOracleLibrary.currentCumulativeTvl(
                tvlOracle
            );
            observation.timestamp = block.timestamp;
            observation.tvlCumulative = tvlCumulative;
        }
        if (canConsult(tvlOracle)) {
            updateTimeWeightedAverageTVL(tvlOracle);
        }
    }

    function updateTimeWeightedAverageTVL(address tvlOracle) internal {
        TimeWeightedAverageTVL
            memory _timeWeightedAverageTVL = TimeWeightedAverageTVL(
                block.timestamp,
                consult(tvlOracle)
            );
        timeWeightedAverageTVL[tvlOracle].push(_timeWeightedAverageTVL);
    }

    /**
     * @notice Gives the latest roundId
     * @param tvlOracle address of the TVL oracle
     */
    function getLatestId(address tvlOracle) external view returns (uint256) {
        return timeWeightedAverageTVL[tvlOracle].length;
    }

    /**
     * @notice Gives the timestamp and weighted average for a roundId
     * @param tvlOracle address of the TVL oracle
     * @param roundId roundID
     */
    function getTimeWeightedAverageTVL(address tvlOracle, uint256 roundId)
        external
        view
        returns (uint256 roundTimestamp, uint256 KPI)
    {
        TimeWeightedAverageTVL memory _tvl = timeWeightedAverageTVL[tvlOracle][
            roundId
        ];
        roundTimestamp = _tvl.timestamp;
        KPI = _tvl.tvl;
    }

    // Checks if its time to call the update function
    function canUpdate(address tvlOracle) public view returns (bool) {
        // get the observation for the current period
        uint8 observationIndex = observationIndexOf(block.timestamp);
        Observation storage observation = tvlObservations[tvlOracle][
            observationIndex
        ];

        // we only want to commit updates once per period (i.e. windowSize / granularity)
        uint256 timeElapsed = block.timestamp - observation.timestamp;
        if (timeElapsed > periodSize) {
            return true;
        }
        return false;
    }

    // Checks if the consult can be called
    function canConsult(address tvlOracle) public view returns (bool) {
        Observation storage firstObservation = getFirstObservationInWindow(
            tvlOracle
        );

        uint256 timeElapsed = block.timestamp - firstObservation.timestamp;
        if (
            (timeElapsed <= windowSize) &&
            (timeElapsed >= windowSize - periodSize * 2)
        ) {
            return true;
        }

        return false;
    }

    /**
     * @notice Given the cumulative tvls of the start and end of a period,
     * and the length of the period, compute the average
     * @param tvlCumulativeStart Starting cumulative of the window
     * @param tvlCumulativeEnd Ending cumulative of the window
     * @param timeElapsed Time elapsed since the start
     */
    function computeTimeWeightedAverage(
        uint256 tvlCumulativeStart,
        uint256 tvlCumulativeEnd,
        uint256 timeElapsed
    ) public pure returns (uint256 weightedAverage) {
        bytes16 _weightedAverage = ABDKMathQuad.div(
            ABDKMathQuad.fromUInt(tvlCumulativeEnd - tvlCumulativeStart),
            ABDKMathQuad.fromUInt(timeElapsed)
        );

        weightedAverage = uint256(ABDKMathQuad.toUInt(_weightedAverage));
    }

    /**
     * @notice returns the amount out corresponding to the amount in for a
     * given token using the moving average over the time
     * range [now - [windowSize, windowSize - periodSize * 2], now]
     * update must have been called for the bucket corresponding to timestamp `now - windowSize`
     * @param tvlOracle address of the TVL oracle to update
     */
    function consult(address tvlOracle)
        public
        view
        returns (uint256 weightedAverage)
    {
        Observation storage firstObservation = getFirstObservationInWindow(
            tvlOracle
        );

        uint256 timeElapsed = block.timestamp - firstObservation.timestamp;
        require(
            timeElapsed <= windowSize,
            "SlidingWindowOracle: MISSING_HISTORICAL_OBSERVATION"
        );

        // should never happen.
        require(
            timeElapsed >= windowSize - periodSize * 2,
            "SlidingWindowOracle: UNEXPECTED_TIME_ELAPSED"
        );

        uint256 tvlCumulative = TvlOracleLibrary.currentCumulativeTvl(
            tvlOracle
        );

        weightedAverage = computeTimeWeightedAverage(
            firstObservation.tvlCumulative,
            tvlCumulative,
            timeElapsed
        );
    }
}
